import { useEffect, useState } from 'react';

const filterByNumber = (value) => {
  const [filterNumber, setFilterNumber] = useState(0);
  console.log('number:', value);
  useEffect
  return [filterNumber, setFilterNumber];
};

export default filterByNumber;

